// WORKS WHEN PLAYER LEAVE/JOIN
function updateAdmins() { 
    // Get all players
    var players = room.getPlayerList();
    if ( players.length == 0 ) return; // No players left, do nothing.
    if ( players.find((player) => player.admin) != null ) return; // There's an admin left so do nothing.
    otokarma = true; ototakim = true; otoharita = true; // if there is no admin, open all bot features
  }

// count team numbers
function countTeams(){
    RedTeam = 0;
    BlueTeam = 0;
    for(let i = 0; i < room.getPlayerList().length; i++){
        if (room.getPlayerList()[i].team == 1){RedTeam+=1}
        else if (room.getPlayerList()[i].team == 2){BlueTeam+=1}
        else if (room.getPlayerList()[i].team == 0){SpecTeam+=1}
    }
    
}
  
// PUT PLAYER TO A TEAM
async function putPlayertoTeam(player,wait){
    if(ototakim == true){
        await new Promise(r => setTimeout(r, wait));
        countTeams();
        if(RedTeam > BlueTeam){room.setPlayerTeam(player.id,2)}
        else if(RedTeam < BlueTeam){room.setPlayerTeam(player.id,1)}
        else if(RedTeam == BlueTeam){room.setPlayerTeam(player.id,1)}
        
    }
}

// MUTE UNMUTE FUNCTIONS
// MUTE
function mute(player_name,admin){
    let playertomute = getPlayerId(player_name);
            
    mute_list.push(playertomute);
    room.sendAnnouncement("["+playertomute+"]"+player_name+" mutelendi.",admin.id,0xc6db3d);
        
    
}
// UNMUTE
function unmute(player_name,admin){
    for(let i = 0; i < mute_list; i++){
        if(player_name == room.getPlayer(mute_list[i]).name){
            mute_list.splice(i,1);
            room.sendAnnouncement(player_name+" mutesi açıldı.",admin.id,0xc6db3d);
        }
    }
}

// BALANCE TEAMS
function balanceTeams(){
    if(ototakim == true){
        countTeams();
        
        if(BlueTeam-RedTeam > 1){
            for(let i = 0; i < room.getPlayerList().length ; i++){
                if(room.getPlayerList()[room.getPlayerList().length-(1+i)].team == 2){room.setPlayerTeam(room.getPlayerList()[room.getPlayerList().length-(1+i)].id,1);break;}
            }
        }
        else if(RedTeam-BlueTeam > 1){
            for(let i = 0; i < room.getPlayerList().length ; i++){
                if(room.getPlayerList()[room.getPlayerList().length-(1+i)].team == 1){room.setPlayerTeam(room.getPlayerList()[room.getPlayerList().length-(1+i)].id,2);break;}
            }
        }

    }
}

// STARTS GAME AND BALANCES TEAMS
async function startGame(){
    room.startGame();
    await new Promise(r => setTimeout(r, 1000));
    balanceTeams();

}

// BAN EMOJİ FROM CHAT
function testEmoji(text){
    return (/\p{Extended_Pictographic}/u.test(text));
}

// DETECTS WHICH MAP TO SET
function botSetMap(){
    countTeams()
    if(RedTeam+BlueTeam > 14){map = x10_futsal}
    else if(RedTeam+BlueTeam > 12){map = x7_laliga}
    else if(RedTeam+BlueTeam > 10){map = x6_futsal}
    else if(RedTeam+BlueTeam > 8){map = x5_futsal}
    else if(RedTeam+BlueTeam > 6){map = x4_futsal}
    else if(RedTeam+BlueTeam > 4){map = x3_futsal}
    else{map = x1_futsal}
    room.setCustomStadium(map);
}



// VOTE KICK
function voteKick(votedplayer,voteonplayer){
    console.log("votekick girdim")
    votedplayer.voted = true;
    voteonplayer.kick += 1;
    var required_vote = (Math.ceil(playerList.length*6/10));
    room.sendAnnouncement("Votekick oylaması: "+voteonplayer.name+", Oy: "+voteonplayer.kick+"/"+required_vote)
    if (voteonplayer.kick == required_vote){
        room.kickPlayer(voteonplayer.id,"Oylama ile atıldınız",false);
        room.sendAnnouncement("Bir oyuncu atıldı. Diğer bütün oylamalar sıfırlandı.")
        for(let i = 0; i < playerList.length; i++){
            playerList[i].voted = false;
            playerList[i].kick = 0; 
        }
    }
}

// AFK CONTROL
async function afkControl(playerList_player){
    while(true){
        if(playerList.includes(playerList_player) == false){
            break;
        }
        if(onGame == true){
            if(playerList_player.team != 0){
                await new Promise(r => setTimeout(r, 5000)); 
                playerList_player.afk += 5;
                if(playerList_player.afk == (afk_limit/2)){
                    room.sendAnnouncement("10 saniye içinde hareket etmezseniz atılacaksınız.",playerList_player.id,0xFF0000)
                }
                else if(playerList_player.afk == afk_limit){
                    room.kickPlayer(playerList_player.id,"Bot tarafından, Sebep: afk ",false);

                    await new Promise(r => setTimeout(r, 2000));
                }
            }
        }
        await new Promise(r => setTimeout(r, 10000)); 
    }  
}

// SPAM CONTROL
async function spamControl(playerList_player){
    playerList_player.spam += 1;
    await new Promise(r => setTimeout(r, 1500)); 
    playerList_player.spam -= 1;
}

// TO FIND A NAMES ID
function getPlayerId(player_name){
    let player_list = room.getPlayerList();
    for(let i = 0; i < player_list.length; i++){
        if(player_list[i].name == player_name){
            return (player_list[i].id);
        }
    }
}

// creates message_control variable and process it to check for blocked words
function messageControl(message){
    var message_control = message.toLowerCase().replace(/\s/g, '');
    
    // letter converter
    for(let i = 0; i < message_control.length; i++){ 
        if(message_control[i] == "4"){message_control = message_control.slice(0,i)+"a"+message_control.slice(i+1,message_control.length)}
        if(message_control[i] == "6"){message_control = message_control.slice(0,i)+"a"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "@"){message_control = message_control.slice(0,i)+"a"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "0"){message_control = message_control.slice(0,i)+"o"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "1"){message_control = message_control.slice(0,i)+"i"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "ı"){message_control = message_control.slice(0,i)+"i"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "8"){message_control = message_control.slice(0,i)+"k"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "q"){message_control = message_control.slice(0,i)+"k"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "x"){message_control = message_control.slice(0,i)+"k"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "ğ"){message_control = message_control.slice(0,i)+"k"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "g"){message_control = message_control.slice(0,i)+"k"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "ç"){message_control = message_control.slice(0,i)+"c"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "ü"){message_control = message_control.slice(0,i)+"u"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "ö"){message_control = message_control.slice(0,i)+"o"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "z"){message_control = message_control.slice(0,i)+"s"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "ş"){message_control = message_control.slice(0,i)+"s"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "5"){message_control = message_control.slice(0,i)+"s"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "3"){message_control = message_control.slice(0,i)+"e"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "7"){message_control = message_control.slice(0,i)+"l"+message_control.slice(i+1,message_control.length)}
        else if(message_control[i] == "w"){message_control = message_control.slice(0,i)+"v"+message_control.slice(i+1,message_control.length)}        
    }
    
    // concantrates letters if they are same, example: "aabbbcc" => "abc"
    for(let i = 0; i < message_control.length; i++){
        if(message_control[i] == message_control[i+1]){
            message_control = message_control.slice(0,i)+message_control[i]+message_control.slice(i+2,message_control.length);
            i = 0;
        } 
    }
    for(let i = 0; i < message_control.length; i++){ 
        if(punctuation_marks.includes(message_control[i])){message_control = message_control.slice(0,i)+""+message_control.slice(i+1,message_control.length)}
    }
    
    return message_control;
}

