// ON TEAM VICTORY
room.onTeamVictory = async function() {
    await new Promise(r => setTimeout(r, 5000));
    if(otokarma == true){   

        await new Promise(r => setTimeout(r, 500));
        room.sendAnnouncement("Takımlar karılıyor...");
        await new Promise(r => setTimeout(r, 50));
        
        for(let i = 0; i < playerList.length; i++){
            KarmaListe.push(playerList[i]);        
            room.setPlayerTeam(playerList[i].id,0);
        }
        console.log(KarmaListe)

        await new Promise(r => setTimeout(r, 1500));

        TeamRandomCounter = 1;
        var random;
        while (KarmaListe.length > 0){
            random = Math.floor(Math.random() * KarmaListe.length);
            if(TeamRandomCounter == 1){
                room.setPlayerTeam(KarmaListe.splice(random,1)[0].id,1);
                TeamRandomCounter = 2;   
            }  
            else if(TeamRandomCounter == 2){
                room.setPlayerTeam(KarmaListe.splice(random,1)[0].id,2);
                TeamRandomCounter = 1;
            }
        }
        await new Promise(r => setTimeout(r, 50));
        room.sendAnnouncement("Takımlar gelişigüzel karıldı.");
        await new Promise(r => setTimeout(r, 50));

        if (otoharita == true){
            room.sendAnnouncement("Harita atanıyor...");
            await new Promise(r => setTimeout(r, 250));
            botSetMap()
        }

        await new Promise(r => setTimeout(r, 500));
        room.sendAnnouncement("Oyun başlatılıyor: 3...");
        await new Promise(r => setTimeout(r, 500));
        room.sendAnnouncement("Oyun başlatılıyor: 2...");
        await new Promise(r => setTimeout(r, 500));
        room.sendAnnouncement("Oyun başlatılıyor: 1...");
        await new Promise(r => setTimeout(r, 500));
        startGame()
        
    }
}



